package com.ps.greenfleet.config;

import io.swagger.v3.oas.models.OpenAPI;
import io.swagger.v3.oas.models.info.Info;
import io.swagger.v3.oas.models.info.Contact;
import org.springframework.context.annotation.Bean;
import org.springframework.context.annotation.Configuration;

@Configuration
public class SwaggerConfig {

    @Bean
    public OpenAPI greenFleetOpenAPI() {
        return new OpenAPI()
                .info(new Info()
                        .title("GreenFleet API")
                        .description("API documentation for GreenFleet Logistics Platform")
                        .version("v1.0")
                        .contact(new Contact()
                                .name("GreenFleet Dev Team")
                                .email("support@greenfleet.com")
                                .url("https://greenfleet.com")
                        )
                );
    }
}

package com.ps.greenfleet.config;


import org.springframework.context.annotation.Configuration;
import org.springframework.messaging.simp.config.MessageBrokerRegistry;
import org.springframework.web.socket.config.annotation.*;

@Configuration
@EnableWebSocketMessageBroker
public class WebSocketConfig implements WebSocketMessageBrokerConfigurer {

    @Override
    public void registerStompEndpoints(StompEndpointRegistry registry) {
        // Client connects here. Allow SockJS fallback.
        registry.addEndpoint("/ws-tracking").setAllowedOriginPatterns("*").withSockJS();
    }

    @Override
    public void configureMessageBroker(MessageBrokerRegistry registry) {
        // simple broker for topics
        registry.enableSimpleBroker("/topic");
        registry.setApplicationDestinationPrefixes("/app");
    }
}

package com.ps.greenfleet.controller;

import com.ps.greenfleet.dto.BookingRequestDTO;
import com.ps.greenfleet.dto.BookingResponseDTO;
import com.ps.greenfleet.serviceInterface.BookingService;
import lombok.RequiredArgsConstructor;
import org.springframework.http.ResponseEntity;
import org.springframework.web.bind.annotation.*;

@RestController
@RequestMapping("/api/bookings")
@RequiredArgsConstructor
public class BookingController {

    private final BookingService bookingService;

    @PostMapping
    public ResponseEntity<BookingResponseDTO> createBooking(@RequestBody BookingRequestDTO req) {
        BookingResponseDTO resp = bookingService.createBooking(req);
        return ResponseEntity.ok(resp);
    }

    @PostMapping("/{bookingId}/start")
    public ResponseEntity<BookingResponseDTO> startBooking(@PathVariable Long bookingId) {
        return ResponseEntity.ok(bookingService.startBooking(bookingId));
    }

    @PostMapping("/{bookingId}/complete")
    public ResponseEntity<BookingResponseDTO> completeBooking(@PathVariable Long bookingId) {
        return ResponseEntity.ok(bookingService.completeBooking(bookingId));
    }

    @GetMapping("/{bookingId}")
    public ResponseEntity<BookingResponseDTO> getBooking(@PathVariable Long bookingId) {
        return ResponseEntity.ok(bookingService.getBooking(bookingId));
    }
}

package com.ps.greenfleet.controller;

import com.ps.greenfleet.dto.ApiResponse;
import com.ps.greenfleet.dto.CompanyDTO;
import com.ps.greenfleet.dto.CompanyVehicleDTO;
import com.ps.greenfleet.serviceInterface.CompanyService;
import lombok.RequiredArgsConstructor;
import org.springframework.http.ResponseEntity;
import org.springframework.web.bind.annotation.*;

import java.util.List;

@RestController
@RequestMapping("/api/company")
@RequiredArgsConstructor
public class CompanyController {

    private final CompanyService companyService;

    @PostMapping("/register")
    public ResponseEntity<ApiResponse<CompanyDTO>> registerCompany(@RequestBody CompanyDTO dto) {
        return ResponseEntity.ok(ApiResponse.<CompanyDTO>builder()
                .message("Company registered successfully")
                .data(companyService.registerCompany(dto))
                .build());
    }

    @PostMapping("/{companyId}/vehicles")
    public ResponseEntity<ApiResponse<List<CompanyVehicleDTO>>> addVehicles(
            @PathVariable Long companyId,
            @RequestBody List<CompanyVehicleDTO> vehicles) {
        return ResponseEntity.ok(ApiResponse.<List<CompanyVehicleDTO>>builder()
                .message("Vehicles added successfully")
                .data(companyService.addCompanyVehicles(companyId, vehicles))
                .build());
    }

    @GetMapping("/{companyId}/vehicles")
    public ResponseEntity<ApiResponse<List<CompanyVehicleDTO>>> getVehicles(@PathVariable Long companyId) {
        return ResponseEntity.ok(ApiResponse.<List<CompanyVehicleDTO>>builder()
                .message("Company vehicles fetched successfully")
                .data(companyService.getCompanyVehicles(companyId))
                .build());
    }

    @GetMapping("/{companyId}/profile")
    public ResponseEntity<ApiResponse<CompanyDTO>> getProfile(@PathVariable Long companyId) {
        return ResponseEntity.ok(ApiResponse.<CompanyDTO>builder()
                .message("Company profile fetched successfully")
                .data(companyService.getCompanyProfile(companyId))
                .build());
    }
}

package com.ps.greenfleet.controller;

import com.ps.greenfleet.dto.DriverCreateRequest;
import com.ps.greenfleet.dto.DriverResponse;
