package com.ps.greenfleet.model;

import com.ps.greenfleet.enums.DriverStatus;
import com.ps.greenfleet.enums.UserRole;
import com.ps.greenfleet.enums.VehicleType;
import jakarta.persistence.*;
import lombok.*;
