package com.ps.greenfleet.service;

import com.ps.greenfleet.dto.BookingRequestDTO;
import com.ps.greenfleet.dto.BookingResponseDTO;
import com.ps.greenfleet.model.Company;
import com.ps.greenfleet.model.CompanyVehicle;
import com.ps.greenfleet.model.VehicleBooking;
import com.ps.greenfleet.repository.CompanyRepository;
import com.ps.greenfleet.repository.CompanyVehicleRepository;
import com.ps.greenfleet.repository.VehicleBookingRepository;
import com.ps.greenfleet.serviceInterface.BookingService;
import lombok.RequiredArgsConstructor;
import org.springframework.stereotype.Service;
import org.springframework.transaction.annotation.Transactional;

import java.time.Instant;
import java.util.Optional;

@Service
@RequiredArgsConstructor
public class BookingServiceImpl implements BookingService {

    private final VehicleBookingRepository bookingRepository;
    private final CompanyRepository companyRepository;
    private final CompanyVehicleRepository vehicleRepository;

    private static final double CO2_ABSORPTION_PER_TREE_KG = 21.77; // kg per tree per year

    @Override
    @Transactional
    public BookingResponseDTO createBooking(BookingRequestDTO req) {
        Company company = companyRepository.findById(req.getCompanyId())
                .orElseThrow(() -> new RuntimeException("Company not found"));

        CompanyVehicle vehicle = vehicleRepository.findById(req.getVehicleId())
                .orElseThrow(() -> new RuntimeException("Vehicle not found"));

        // Use provided distance if present; otherwise it must be computed by frontend or route service
        Double distanceKm = req.getDistanceKm() != null ? req.getDistanceKm() : 0.0;
        Long estimatedTimeSeconds = req.getEstimatedTimeSeconds();

        // compute CO2: assuming vehicle.co2PerKm is stored in kg/km
        double co2EmittedKg = distanceKm * (vehicle.getCo2PerKm() == null ? 0.0 : vehicle.getCo2PerKm());
        int trees = (int) Math.ceil(co2EmittedKg / CO2_ABSORPTION_PER_TREE_KG);

        VehicleBooking booking = VehicleBooking.builder()
                .company(company)
                .vehicle(vehicle)
                .sourceAddress(req.getSourceAddress())
                .sourceLat(req.getSourceLat())
                .sourceLng(req.getSourceLng())
                .destinationAddress(req.getDestinationAddress())
                .destinationLat(req.getDestinationLat())
                .destinationLng(req.getDestinationLng())
                .distanceKm(distanceKm)
                .estimatedTimeSeconds(estimatedTimeSeconds)
                .co2EmittedKg(co2EmittedKg)
                .treesToPlant(trees)
                .createdAt(Instant.now())
                .status("CREATED")
                .build();

        VehicleBooking saved = bookingRepository.save(booking);

        // Optionally update company's totalCo2Emitted (aggregate) - here we don't commit to running total until trip completes,
        // but if you want to count scheduled bookings immediately you can add co2 now.
        BookingResponseDTO resp = BookingResponseDTO.builder()
                .bookingId(saved.getId())
                .status(saved.getStatus())
                .distanceKm(saved.getDistanceKm())
                .estimatedTimeSeconds(saved.getEstimatedTimeSeconds())
                .co2EmittedKg(saved.getCo2EmittedKg())
                .treesToPlant(saved.getTreesToPlant())
                .build();

        return resp;
    }

    @Override
    @Transactional
    public BookingResponseDTO startBooking(Long bookingId) {
        VehicleBooking b = bookingRepository.findById(bookingId)
                .orElseThrow(() -> new RuntimeException("Booking not found"));
        b.setStatus("IN_PROGRESS");
        b.setStartedAt(Instant.now());
        bookingRepository.save(b);
        return toDto(b);
    }

    @Override
    @Transactional
    public BookingResponseDTO completeBooking(Long bookingId) {
        VehicleBooking b = bookingRepository.findById(bookingId)
                .orElseThrow(() -> new RuntimeException("Booking not found"));
        b.setStatus("COMPLETED");
        b.setCompletedAt(Instant.now());
        bookingRepository.save(b);

        // update company total CO2 emitted aggregate
        Company company = b.getCompany();
        if (company != null) {
            Double prev = company.getTotalCo2Emitted() == null ? 0.0 : company.getTotalCo2Emitted();
            company.setTotalCo2Emitted(prev + (b.getCo2EmittedKg() == null ? 0.0 : b.getCo2EmittedKg()));
            companyRepository.save(company);
        }

        return toDto(b);
    }

    @Override
    public BookingResponseDTO getBooking(Long bookingId) {
        VehicleBooking b = bookingRepository.findById(bookingId)
                .orElseThrow(() -> new RuntimeException("Booking not found"));
        return toDto(b);
    }

    private BookingResponseDTO toDto(VehicleBooking b) {
        return BookingResponseDTO.builder()
                .bookingId(b.getId())
                .status(b.getStatus())
                .distanceKm(b.getDistanceKm())
                .estimatedTimeSeconds(b.getEstimatedTimeSeconds())
                .co2EmittedKg(b.getCo2EmittedKg())
                .treesToPlant(b.getTreesToPlant())
                .build();
    }
}

package com.ps.greenfleet.service;
import com.ps.greenfleet.dto.CompanyDTO;
import com.ps.greenfleet.dto.CompanyVehicleDTO;
import com.ps.greenfleet.model.Company;
import com.ps.greenfleet.model.CompanyVehicle;
import com.ps.greenfleet.repository.CompanyRepository;
import com.ps.greenfleet.repository.CompanyVehicleRepository;
import com.ps.greenfleet.serviceInterface.CompanyService;
import lombok.RequiredArgsConstructor;
import org.springframework.stereotype.Service;

import java.util.List;
import java.util.stream.Collectors;

@Service
@RequiredArgsConstructor
public class CompanyServiceImpl implements CompanyService {

    private final CompanyRepository companyRepository;
    private final CompanyVehicleRepository vehicleRepository;

    @Override
    public CompanyDTO registerCompany(CompanyDTO dto) {
        Company company = Company.builder()
                .name(dto.getName())
                .email(dto.getEmail())
                .industry(dto.getIndustry())
                .password("hashed_password") // TODO: hash real password later
                .build();
        Company saved = companyRepository.save(company);
        return mapToDTO(saved);
    }

    @Override
    public List<CompanyVehicleDTO> addCompanyVehicles(Long companyId, List<CompanyVehicleDTO> vehicles) {
        Company company = companyRepository.findById(companyId)
                .orElseThrow(() -> new RuntimeException("Company not found"));

        List<CompanyVehicle> entityList = vehicles.stream().map(v ->
                CompanyVehicle.builder()
                        .vehicleType(v.getVehicleType())
                        .capacity(v.getCapacity())
                        .age(v.getAge())
                        .pucCertificate(v.getPucCertificate())
                        .co2PerKm(v.getCo2PerKm())
                        .starRating(v.getStarRating())
                        .company(company)
                        .build()
        ).collect(Collectors.toList());

        return vehicleRepository.saveAll(entityList)
                .stream().map(this::mapVehicleToDTO)
                .collect(Collectors.toList());
    }

    @Override
    public List<CompanyVehicleDTO> getCompanyVehicles(Long companyId) {
        return vehicleRepository.findByCompanyId(companyId)
                .stream().map(this::mapVehicleToDTO)
                .collect(Collectors.toList());
    }

    @Override
    public CompanyDTO getCompanyProfile(Long companyId) {
        Company company = companyRepository.findById(companyId)
                .orElseThrow(() -> new RuntimeException("Company not found"));
        return mapToDTO(company);
    }

    private CompanyDTO mapToDTO(Company company) {
        return CompanyDTO.builder()
                .id(company.getId())
                .name(company.getName())
                .email(company.getEmail())
                .industry(company.getIndustry())
                .totalCo2Emitted(company.getTotalCo2Emitted())
                .build();
    }

    private CompanyVehicleDTO mapVehicleToDTO(CompanyVehicle vehicle) {
        return CompanyVehicleDTO.builder()
                .id(vehicle.getId())
                .vehicleType(vehicle.getVehicleType())
                .capacity(vehicle.getCapacity())
                .age(vehicle.getAge())
                .pucCertificate(vehicle.getPucCertificate())
                .co2PerKm(vehicle.getCo2PerKm())
                .starRating(vehicle.getStarRating())
                .build();
    }
}

package com.ps.greenfleet.service;


import com.ps.greenfleet.dto.DriverCreateRequest;
import com.ps.greenfleet.dto.DriverResponse;
import com.ps.greenfleet.dto.DriverUpdateRequest;
import com.ps.greenfleet.mapper.DriverMapper;
import com.ps.greenfleet.model.Driver;
import com.ps.greenfleet.repository.DriverRepository;
import com.ps.greenfleet.serviceInterface.DriverService;
import lombok.RequiredArgsConstructor;
import org.springframework.stereotype.Service;
import org.springframework.transaction.annotation.Transactional;

import java.util.List;
import java.util.UUID;
import java.util.stream.Collectors;

@Service
@RequiredArgsConstructor
@Transactional
public class DriverServiceImpl implements DriverService {

    private final DriverRepository repository;

    @Override
    public DriverResponse createDriver(DriverCreateRequest dto) {
        Driver driver = DriverMapper.toEntity(dto);
        return DriverMapper.toResponse(repository.save(driver));
    }

    @Override
    public DriverResponse updateDriver(String driverId, DriverUpdateRequest dto) {
        Driver driver = repository.findById(driverId)
                .orElseThrow(() -> new RuntimeException("Driver not found"));
        DriverMapper.updateEntity(driver, dto);
        return DriverMapper.toResponse(repository.save(driver));
    }

    @Override
    public DriverResponse getDriver(String driverId) {
        return repository.findById(driverId)
                .map(DriverMapper::toResponse)
                .orElseThrow(() -> new RuntimeException("Driver not found"));
    }

    @Override
    public List<DriverResponse> listDrivers(String tenantId, String status, Boolean independentOnly) {
        UUID tenantUuid = UUID.fromString(tenantId);
        List<Driver> drivers;
        if (independentOnly != null && independentOnly) {
            drivers = repository.findByTenantIdIsNull();
        } else if (tenantId != null) {
            drivers = repository.findByTenantId(tenantUuid);
        } else if (status != null) {
            drivers = repository.findByStatus(status);
        } else {
            drivers = repository.findAll();
        }
        return drivers.stream().map(DriverMapper::toResponse).collect(Collectors.toList());
    }

    @Override
    public void deleteDriver(String driverId) {
        repository.deleteById(driverId);
    }

    @Override
    public DriverResponse assignVehicle(String driverId, String vehicleId) {
        UUID vehicleUuid = UUID.fromString(vehicleId);
        Driver driver = repository.findById(driverId)
                .orElseThrow(() -> new RuntimeException("Driver not found"));
        driver.setAssignedVehicleId(vehicleUuid);
        return DriverMapper.toResponse(repository.save(driver));
    }

    @Override
    public DriverResponse unassignVehicle(String driverId) {
        Driver driver = repository.findById(driverId)
                .orElseThrow(() -> new RuntimeException("Driver not found"));
        driver.setAssignedVehicleId(null);
        return DriverMapper.toResponse(repository.save(driver));
    }
}

package com.ps.greenfleet.service;

import com.ps.greenfleet.dto.TrackingLocationDTO;
import com.ps.greenfleet.dto.TrackingUpdateDTO;
import com.ps.greenfleet.model.TrackingPoint;
import com.ps.greenfleet.repository.TrackingPointRepository;
import com.ps.greenfleet.serviceInterface.TrackingService;
import lombok.RequiredArgsConstructor;
import org.springframework.messaging.simp.SimpMessagingTemplate;
import org.springframework.stereotype.Service;

import java.time.Instant;
import java.util.List;
import java.util.stream.Collectors;

@Service
@RequiredArgsConstructor
public class TrackingServiceImpl implements TrackingService {

    private final TrackingPointRepository trackingRepository;
    private final SimpMessagingTemplate messagingTemplate; // to publish to websocket topics

    private static final String TRACKING_TOPIC_PREFIX = "/topic/tracking/"; // client subscribes to /topic/tracking/{bookingId}

    @Override
    public void pushLocationUpdate(TrackingUpdateDTO update) {
        TrackingPoint p = TrackingPoint.builder()
                .bookingId(update.getBookingId())
                .lat(update.getLat())
                .lng(update.getLng())
                .bearing(update.getBearing())
                .timestamp(Instant.ofEpochMilli(update.getTimestampEpochMillis()))
                .build();

        trackingRepository.save(p);

        // push to subscribers
        TrackingLocationDTO loc = TrackingLocationDTO.builder()
                .bookingId(update.getBookingId())
                .lat(update.getLat())
                .lng(update.getLng())
                .bearing(update.getBearing())
                .timestampEpochMillis(update.getTimestampEpochMillis())
                .build();

        messagingTemplate.convertAndSend(TRACKING_TOPIC_PREFIX + update.getBookingId(), loc);
    }

    @Override
    public List<TrackingLocationDTO> getTrackingForBooking(Long bookingId) {
        return trackingRepository.findByBookingIdOrderByTimestampAsc(bookingId)
                .stream()
                .map(p -> TrackingLocationDTO.builder()
                        .bookingId(p.getBookingId())
                        .lat(p.getLat())
                        .lng(p.getLng())
                        .bearing(p.getBearing())
                        .timestampEpochMillis(p.getTimestamp().toEpochMilli())
                        .build())
                .collect(Collectors.toList());
    }
}

package com.ps.greenfleet.service;


import com.ps.greenfleet.dto.VehicleCreateRequest;
import com.ps.greenfleet.dto.VehicleResponse;
import com.ps.greenfleet.dto.VehicleUpdateRequest;
import com.ps.greenfleet.mapper.VehicleMapper;
import com.ps.greenfleet.model.Driver;
import com.ps.greenfleet.model.Vehicle;
import com.ps.greenfleet.repository.DriverRepository;
import com.ps.greenfleet.repository.VehicleRepository;
import com.ps.greenfleet.serviceInterface.VehicleService;
import lombok.RequiredArgsConstructor;
import org.springframework.stereotype.Service;
import org.springframework.transaction.annotation.Transactional;

import java.util.List;

@Service
@RequiredArgsConstructor
@Transactional
public class VehicleServiceImpl implements VehicleService {

    private final VehicleRepository vehicleRepository;
    private final DriverRepository driverRepository;

    @Override
    public VehicleResponse create(VehicleCreateRequest request) {
        Vehicle vehicle = VehicleMapper.toEntity(request);
        return VehicleMapper.toResponse(vehicleRepository.save(vehicle));
    }

    @Override
    public VehicleResponse update(String vehicleId, VehicleUpdateRequest request) {
        Vehicle vehicle = vehicleRepository.findById(vehicleId)
                .orElseThrow(() -> new RuntimeException("Vehicle not found"));
        vehicle.setMake(request.getMake());
        vehicle.setModel(request.getModel());
        vehicle.setYear(request.getYear());
        vehicle.setType(request.getType());
        vehicle.setCapacityKg(request.getCapacityKg());
        vehicle.setCo2PerKm(request.getCo2PerKm());
        vehicle.setIsAvailable(request.getIsAvailable());
        return VehicleMapper.toResponse(vehicleRepository.save(vehicle));
    }

    @Override
    public void delete(String vehicleId) {
        vehicleRepository.deleteById(vehicleId);
    }

    @Override
    @Transactional(readOnly = true)
    public VehicleResponse getById(String vehicleId) {
        return vehicleRepository.findById(vehicleId)
                .map(VehicleMapper::toResponse)
                .orElseThrow(() -> new RuntimeException("Vehicle not found"));
    }

    @Override
    @Transactional(readOnly = true)
    public List<VehicleResponse> listAll(String tenantId) {
        List<Vehicle> vehicles = tenantId != null
                ? vehicleRepository.findByTenantId(tenantId)
                : vehicleRepository.findAll();
        return vehicles.stream().map(VehicleMapper::toResponse).toList();
    }

    @Override
    public VehicleResponse assignDriver(String vehicleId, String driverId) {
        Vehicle vehicle = vehicleRepository.findById(vehicleId)
                .orElseThrow(() -> new RuntimeException("Vehicle not found"));
        Driver driver = driverRepository.findById(driverId)
                .orElseThrow(() -> new RuntimeException("Driver not found"));
        vehicle.setAssignedDriver(driver);
        vehicle.setIsAvailable(false);
        return VehicleMapper.toResponse(vehicleRepository.save(vehicle));
    }

    @Override
    public VehicleResponse unassignDriver(String vehicleId) {
        Vehicle vehicle = vehicleRepository.findById(vehicleId)
                .orElseThrow(() -> new RuntimeException("Vehicle not found"));
        vehicle.setAssignedDriver(null);
        vehicle.setIsAvailable(true);
        return VehicleMapper.toResponse(vehicleRepository.save(vehicle));
    }
}

